import React, { Component } from 'react';

class Cv extends Component {


  renderLoadingState = () => (
    <div className="post-loading">
      Post
    </div>
  )
  render() {
    return (
      <div>
        {this.renderLoadingState()}<p>hashda</p>
        <div>Hallo
        <h1>test
        </h1></div>
      </div>
    );
  }
}

export default Cv;
